define(["angular"],function(angular){"use strict";angular.module("callcenterApp.controllers.TimePickerCtrl",[]).controller("TimePickerCtrl",["$scope",function($scope){function disabled(data){var date=data.date,mode=data.mode;return"day"===mode&&(0===date.getDay()||6===date.getDay())}function getDayClass(data){var date=data.date,mode=data.mode;if("day"===mode)for(var dayToCheck=new Date(date).setHours(0,0,0,0),i=0;i<$scope.events.length;i++){var currentDay=new Date($scope.events[i].date).setHours(0,0,0,0);if(dayToCheck===currentDay)return $scope.events[i].status}return""}$scope.endtimeout="",$scope.startimeout="",$scope.today=function(){$scope.dt=new Date},$scope.today(),$scope.clear=function(){$scope.dt=null},$scope.inlineOptions={customClass:getDayClass,minDate:new Date,showWeeks:!0},$scope.dateOptions={dateDisabled:disabled,formatYear:"yy",maxDate:new Date(2020,5,22),minDate:new Date,startingDay:1},$scope.toggleMin=function(){$scope.inlineOptions.minDate=$scope.inlineOptions.minDate?null:new Date,$scope.dateOptions.minDate=$scope.inlineOptions.minDate},$scope.toggleMin(),$scope.open1=function(){$scope.popup1.opened=!0},$scope.open2=function(){$scope.popup2.opened=!0},$scope.setDate=function(year,month,day){$scope.dt=new Date(year,month,day)},$scope.popup1={opened:!1},$scope.popup2={opened:!1};var tomorrow=new Date;tomorrow.setDate(tomorrow.getDate()+1);var afterTomorrow=new Date;afterTomorrow.setDate(tomorrow.getDate()+1),$scope.events=[{date:tomorrow,status:"full"},{date:afterTomorrow,status:"partially"}]}])});